import { Injectable } from '@angular/core';
import { ThromboseRenale } from '../models/ThromboseRenale';
import { HttpClient, HttpResponse } from '@angular/common/http';
import { Observable } from 'rxjs';

@Injectable({
  providedIn: 'root'
})
export class ThrenaleService {

 
  private apiUrl = 'https://localhost:7129/api/ThromboseRenales';

  constructor(private http: HttpClient) { }
  addrenale(ThromboseRenale: ThromboseRenale): Observable<HttpResponse<any>> {
    console.log('Creating it with data:', ThromboseRenale);

    return this.http.post<any>(`${this.apiUrl}/addrenale`, ThromboseRenale, { observe: 'response' });
  }}
